import{_ as s,D as t,c as d,I as e,a2 as i,j as o,o as r}from"./chunks/framework.-9P5VKzf.js";const F=JSON.parse('{"title":"","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"tr/quran/67.md","filePath":"tr/quran/67.md"}'),v={name:"tr/quran/67.md"},_=i('<div class="chapter-title-wrapper"><div class="chapter-title">67</div><div class="chapter-title-slovak">Kráľovstvo</div><div class="chapter-opening">115</div><div class="chapter-opening-slovak">Rahman ve Rahim olan Allah&#39;ın adıyla</div></div><div class="intro2-wrapper"><div class="chapter-info-wrapper"><div class="chapter-info-translation">Meali</div><div class="chapter-info-name">Diyanet Vakfı Meali</div></div></div><h2 id="_1" tabindex="-1">1 <a class="header-anchor" href="#_1" aria-label="Permalink to &quot;1&quot;">​</a></h2>',3),l=i('<div><div class="main-verse"><h1 class="verse-arabic">تَبَـٰرَكَ ٱلَّذِى بِيَدِهِ ٱلْمُلْكُ وَهُوَ عَلَىٰ كُلِّ شَىْءٍ قَدِيرٌ ١</h1></div><p>Požehnaním oplýva (Boh) Ten, v ruke (v moci) ktorého je kráľovstvo (nebies a zeme). On (Boh) má nad všetkým moc,</p></div><div class="break"></div><h2 id="_2" tabindex="-1">2 <a class="header-anchor" href="#_2" aria-label="Permalink to &quot;2&quot;">​</a></h2>',3),n=i('<div><div class="main-verse"><h1 class="verse-arabic">ٱلَّذِى خَلَقَ ٱلْمَوْتَ وَٱلْحَيَوٰةَ لِيَبْلُوَكُمْ أَيُّكُمْ أَحْسَنُ عَمَلًا ۚ وَهُوَ ٱلْعَزِيزُ ٱلْغَفُورُ ٢</h1></div><p>Ktorý stvoril smrť a život, aby vás skúške podrobil, kto z vás bude lepšie konať. On (Boh) je mocný a odpúšťajúci,</p></div><div class="break"></div><h2 id="_3" tabindex="-1">3 <a class="header-anchor" href="#_3" aria-label="Permalink to &quot;3&quot;">​</a></h2>',3),h=i('<div><div class="main-verse"><h1 class="verse-arabic">ٱلَّذِى خَلَقَ سَبْعَ سَمَـٰوَٰتٍ طِبَاقًا ۖ مَّا تَرَىٰ فِى خَلْقِ ٱلرَّحْمَـٰنِ مِن تَفَـٰوُتٍ ۖ فَٱرْجِعِ ٱلْبَصَرَ هَلْ تَرَىٰ مِن فُطُورٍ ٣</h1></div><p>Ktorý stvoril sedem nebies úplne podobných (slovo, ktoré sme preložili ako „úplne podobných“ môže niesť aj význam „jedno nebo nad druhým“ alebo „v určitých vrstvách“), neuvidíš (ty, ktorý sa pozeráš) žiadne rozdiely v tom, čo Ten, v moci ktorého je milosť (Boh), stvoril (všetko je súmerné, rovnomerné a vyvážené). Obráť zrak svoj (smerom k nim), vidíš niekde akékoľvek trhliny (rozdiely alebo nevyváženie)?</p></div><div class="break"></div><h2 id="_4" tabindex="-1">4 <a class="header-anchor" href="#_4" aria-label="Permalink to &quot;4&quot;">​</a></h2>',3),c=i('<div><div class="main-verse"><h1 class="verse-arabic">ثُمَّ ٱرْجِعِ ٱلْبَصَرَ كَرَّتَيْنِ يَنقَلِبْ إِلَيْكَ ٱلْبَصَرُ خَاسِئًا وَهُوَ حَسِيرٌ ٤</h1></div><p>Potom (ak sa na ne pozrieš, znova) obráť svoj zrak (znova skús hľadať akékoľvek rozdiely v nich) ešte dvakrát, zrak (pohľad) sa vráti k tebe späť bezúspešne (bez toho, aby našiel, čo hľadal) a pritom bude zarmútený (z toho, že žiadne rozdiely alebo nevyváženosť nenašiel).</p></div><div class="break"></div><h2 id="_5" tabindex="-1">5 <a class="header-anchor" href="#_5" aria-label="Permalink to &quot;5&quot;">​</a></h2>',3),m=i('<div><div class="main-verse"><h1 class="verse-arabic">وَلَقَدْ زَيَّنَّا ٱلسَّمَآءَ ٱلدُّنْيَا بِمَصَـٰبِيحَ وَجَعَلْنَـٰهَا رُجُومًا لِّلشَّيَـٰطِينِ ۖ وَأَعْتَدْنَا لَهُمْ عَذَابَ ٱلسَّعِيرِ ٥</h1></div><p>Ozdobili sme dolné (alebo najbližšie) nebo lampami (hviezdami, aby vám v noci svietili) a učinili sme ich (tieto lampy) vyvrhnutím pre satanov (a ochranou ľuďom pred nimi) a pripravili sme pre nich (satanov) trápenie ohňa planúceho.</p></div><div class="break"></div><h2 id="_6" tabindex="-1">6 <a class="header-anchor" href="#_6" aria-label="Permalink to &quot;6&quot;">​</a></h2>',3),b=i('<div><div class="main-verse"><h1 class="verse-arabic">وَلِلَّذِينَ كَفَرُوا بِرَبِّهِمْ عَذَابُ جَهَنَّمَ ۖ وَبِئْسَ ٱلْمَصِيرُ ٦</h1></div><p>Tým, ktorí odmietali veriť vo svojho Pána, sa dostane trápenie pekla. Je to veru koniec zlý.</p></div><div class="break"></div><h2 id="_7" tabindex="-1">7 <a class="header-anchor" href="#_7" aria-label="Permalink to &quot;7&quot;">​</a></h2>',3),p=i('<div><div class="main-verse"><h1 class="verse-arabic">إِذَآ أُلْقُوا فِيهَا سَمِعُوا لَهَا شَهِيقًا وَهِىَ تَفُورُ ٧</h1></div><p>Keď budú do neho (do pekla) hodení, budú počúvať, ako sa (peklo) nadýchne pritom, ako kypí,</p></div><div class="break"></div><h2 id="_8" tabindex="-1">8 <a class="header-anchor" href="#_8" aria-label="Permalink to &quot;8&quot;">​</a></h2>',3),k=i('<div><div class="main-verse"><h1 class="verse-arabic">تَكَادُ تَمَيَّزُ مِنَ ٱلْغَيْظِ ۖ كُلَّمَآ أُلْقِىَ فِيهَا فَوْجٌ سَأَلَهُمْ خَزَنَتُهَآ أَلَمْ يَأْتِكُمْ نَذِيرٌ ٨</h1></div><p>Takmer sa (peklo) roztrhne (praskne, vybuchne) od zloby. Vždy, keď je do neho (do pekla) hodený húf (ľudí), jeho strážcovia sa ich spýtajú (týchto ľudí): „Neprišiel k vám varovateľ (ktorý vás varoval pred týmto dňom a trápením, do ktorého ste sa dostali)?“,</p></div><div class="break"></div><h2 id="_9" tabindex="-1">9 <a class="header-anchor" href="#_9" aria-label="Permalink to &quot;9&quot;">​</a></h2>',3),T=i('<div><div class="main-verse"><h1 class="verse-arabic">قَالُوا بَلَىٰ قَدْ جَآءَنَا نَذِيرٌ فَكَذَّبْنَا وَقُلْنَا مَا نَزَّلَ ٱللَّهُ مِن شَىْءٍ إِنْ أَنتُمْ إِلَّا فِى ضَلَـٰلٍ كَبِيرٍ ٩</h1></div><p>Povedia (títo ľudia do pekla hodení): „Veru áno, prišiel k nám varovateľ, my sme to ale za lož označili (jeho i to, s čím prišiel) a povedali sme: Boh nič nezoslal dole, vy ste len v blude veľkom“,</p></div><div class="break"></div><h2 id="_10" tabindex="-1">10 <a class="header-anchor" href="#_10" aria-label="Permalink to &quot;10&quot;">​</a></h2>',3),u=i('<div><div class="main-verse"><h1 class="verse-arabic">وَقَالُوا لَوْ كُنَّا نَسْمَعُ أَوْ نَعْقِلُ مَا كُنَّا فِىٓ أَصْحَـٰبِ ٱلسَّعِيرِ ١٠</h1></div><p>Povedia (tí, ktorí do ohňa budú hodení, dodávajúc): „Keby sme boli počúvali alebo chápali (a vnímali, s čím k nám poslovia prichádzali), neboli by sme teraz medzi obyvateľmi ohňa planúceho“.</p></div><div class="break"></div><h2 id="_11" tabindex="-1">11 <a class="header-anchor" href="#_11" aria-label="Permalink to &quot;11&quot;">​</a></h2>',3),P=i('<div><div class="main-verse"><h1 class="verse-arabic">فَٱعْتَرَفُوا بِذَنۢبِهِمْ فَسُحْقًا لِّأَصْحَـٰبِ ٱلسَّعِيرِ ١١</h1></div><p>Priznajú svoj hriech (spočívajúci v odmietaní poslov a posolstiev od Boha zoslaných). Preč do hlbín (ďaleko od Božej milosti) s obyvateľmi ohňa planúceho.</p></div><div class="break"></div><h2 id="_12" tabindex="-1">12 <a class="header-anchor" href="#_12" aria-label="Permalink to &quot;12&quot;">​</a></h2>',3),A=i('<div><div class="main-verse"><h1 class="verse-arabic">إِنَّ ٱلَّذِينَ يَخْشَوْنَ رَبَّهُم بِٱلْغَيْبِ لَهُم مَّغْفِرَةٌ وَأَجْرٌ كَبِيرٌ ١٢</h1></div><p>Tí, ktorí sa boja Pána svojho, aj keď Ho bližšie nepoznajú (kto sa Boha bojí aj bez toho, aby Ho priamo pred sebou videl), tým sa dostane odpustenie a odmena veľká.</p></div><div class="break"></div><h2 id="_13" tabindex="-1">13 <a class="header-anchor" href="#_13" aria-label="Permalink to &quot;13&quot;">​</a></h2>',3),S=i('<div><div class="main-verse"><h1 class="verse-arabic">وَأَسِرُّوا قَوْلَكُمْ أَوِ ٱجْهَرُوا بِهِۦٓ ۖ إِنَّهُۥ عَلِيمٌ بِذَاتِ ٱلصُّدُورِ ١٣</h1></div><p>Tajte to, čo hovoríte, alebo to zverejnite, On (Boh aj tak) dobre pozná, čo je v hrudiach skryté (Boh dobre vie, ako každý premýšľa a ako by sa zachoval),</p></div><details class="details custom-block"><summary>Tafsir</summary><p>Verš bol zoslaný o tých z kmeňa Qurejš, ktorí ohovárali a ubližovali poslovi a prorokovi Muhammadovi a ktorí dbali na to, aby proroka v tajnosti ohovárali.</p></details><div class="break"></div><h2 id="_14" tabindex="-1">14 <a class="header-anchor" href="#_14" aria-label="Permalink to &quot;14&quot;">​</a></h2>',4),y=i('<div><div class="main-verse"><h1 class="verse-arabic">أَلَا يَعْلَمُ مَنْ خَلَقَ وَهُوَ ٱللَّطِيفُ ٱلْخَبِيرُ ١٤</h1></div><p>A či nepozná (Boh), koho stvoril? (Boh pozná každého, koho stvoril) On (Boh) je milostivý a všeznalý (vie, čo je pre vás dobré, preto to zoslal).</p></div><div class="break"></div><h2 id="_15" tabindex="-1">15 <a class="header-anchor" href="#_15" aria-label="Permalink to &quot;15&quot;">​</a></h2>',3),z=i('<div><div class="main-verse"><h1 class="verse-arabic">هُوَ ٱلَّذِى جَعَلَ لَكُمُ ٱلْأَرْضَ ذَلُولًا فَٱمْشُوا فِى مَنَاكِبِهَا وَكُلُوا مِن رِّزْقِهِۦ ۖ وَإِلَيْهِ ٱلنُّشُورُ ١٥</h1></div><p>On (Boh) je ten, kto učinil zem vám poddajnú, kráčajte (a putujte) po jej končinách a jedzte z toho, čo vám dal. K Nemu (k Bohu) bude smerovať (vaše) oživenie (v deň zmŕtvychvstania, kedy budete pred Bohom stáť).</p></div><div class="break"></div><h2 id="_16" tabindex="-1">16 <a class="header-anchor" href="#_16" aria-label="Permalink to &quot;16&quot;">​</a></h2>',3),j=i('<div><div class="main-verse"><h1 class="verse-arabic">ءَأَمِنتُم مَّن فِى ٱلسَّمَآءِ أَن يَخْسِفَ بِكُمُ ٱلْأَرْضَ فَإِذَا هِىَ تَمُورُ ١٦</h1></div><p>Máte záruku (vy, ktorí odmietate veriť) od Toho, kto je v nebi, že vás nedá zemou pohltiť a ona (zem) sa rozbúri (a otrasie ako pri zemetrasení)?</p></div><div class="break"></div><h2 id="_17" tabindex="-1">17 <a class="header-anchor" href="#_17" aria-label="Permalink to &quot;17&quot;">​</a></h2>',3),f=i('<div><div class="main-verse"><h1 class="verse-arabic">أَمْ أَمِنتُم مَّن فِى ٱلسَّمَآءِ أَن يُرْسِلَ عَلَيْكُمْ حَاصِبًا ۖ فَسَتَعْلَمُونَ كَيْفَ نَذِيرِ ١٧</h1></div><p>Alebo máte záruku (vy, ktorí odmietate veriť) od Toho, kto je v nebi, že na vás nepošle štrkovú smršť (smršť plnú štrku a kameňov). Budete vedieť, aké varovanie to bolo (či bolo pravdivé, alebo nie).</p></div><div class="break"></div><h2 id="_18" tabindex="-1">18 <a class="header-anchor" href="#_18" aria-label="Permalink to &quot;18&quot;">​</a></h2>',3),V=i('<div><div class="main-verse"><h1 class="verse-arabic">وَلَقَدْ كَذَّبَ ٱلَّذِينَ مِن قَبْلِهِمْ فَكَيْفَ كَانَ نَكِيرِ ١٨</h1></div><p>Za lož už označili (poslov, ktorí boli k nim poslaní) tí, ktorí boli pred nimi (pred týmito z kmeňa Qurejš). Aké to bolo odmietnutie (mali ohľadom tohto odmietnutia pravdu, alebo nemali, dostavilo sa k nim trápenie, pred ktorým boli varovaní, alebo nie)?</p></div><div class="break"></div><h2 id="_19" tabindex="-1">19 <a class="header-anchor" href="#_19" aria-label="Permalink to &quot;19&quot;">​</a></h2>',3),q=i('<div><div class="main-verse"><h1 class="verse-arabic">أَوَلَمْ يَرَوْا إِلَى ٱلطَّيْرِ فَوْقَهُمْ صَـٰٓفَّـٰتٍ وَيَقْبِضْنَ ۚ مَا يُمْسِكُهُنَّ إِلَّا ٱلرَّحْمَـٰنُ ۚ إِنَّهُۥ بِكُلِّ شَىْءٍ بَصِيرٌ ١٩</h1></div><p>Nevideli vtákov nad sebou, ako rozprestierajú a skladajú krídla svoje? Nik ich nedrží (vo vzduchu), len (Boh) Ten, v moci ktorého je milosť. Veď (Boh) On všetko vidí.</p></div><div class="break"></div><h2 id="_20" tabindex="-1">20 <a class="header-anchor" href="#_20" aria-label="Permalink to &quot;20&quot;">​</a></h2>',3),x=i('<div><div class="main-verse"><h1 class="verse-arabic">أَمَّنْ هَـٰذَا ٱلَّذِى هُوَ جُندٌ لَّكُمْ يَنصُرُكُم مِّن دُونِ ٱلرَّحْمَـٰنِ ۚ إِنِ ٱلْكَـٰفِرُونَ إِلَّا فِى غُرُورٍ ٢٠</h1></div><p>Kto je ten, kto vojskom je pre vás (kto by vás ochránil), ktorý by vám pomohol a podporil mimo Toho, v moci ktorého je milosť? Tí, ktorí odmietajú veriť, sú (nachádzajú sa) len v klame (keď si myslia, že modly a božstvá, ktoré mimo Boha alebo popri ňom uctievajú, im v niečom pomôžu).</p></div><div class="break"></div><h2 id="_21" tabindex="-1">21 <a class="header-anchor" href="#_21" aria-label="Permalink to &quot;21&quot;">​</a></h2>',3),I=i('<div><div class="main-verse"><h1 class="verse-arabic">أَمَّنْ هَـٰذَا ٱلَّذِى يَرْزُقُكُمْ إِنْ أَمْسَكَ رِزْقَهُۥ ۚ بَل لَّجُّوا فِى عُتُوٍّ وَنُفُورٍ ٢١</h1></div><p>Kto je ten, kto vám dá (obživu), ak by On (Boh) zadržal potravu svoju (ktorú vám posiela)? Oni (sa nepoučili) ale ešte tvrdohlavejšími ostali v povýšení a v odpudení.</p></div><div class="break"></div><h2 id="_22" tabindex="-1">22 <a class="header-anchor" href="#_22" aria-label="Permalink to &quot;22&quot;">​</a></h2>',3),C=i('<div><div class="main-verse"><h1 class="verse-arabic">أَفَمَن يَمْشِى مُكِبًّا عَلَىٰ وَجْهِهِۦٓ أَهْدَىٰٓ أَمَّن يَمْشِى سَوِيًّا عَلَىٰ صِرَٰطٍ مُّسْتَقِيمٍ ٢٢</h1></div><p>Je ten, kto kráča tápajúc (bezcieľne nevediac, kam ide), správnejšie usmernený, alebo ten, kto kráča po ceste rovnej (správnej)?</p></div><details class="details custom-block"><summary>Tafsir</summary><p>Ide tu o porovnanie veriaceho človeka s človekom neveriacim alebo odmietajúcim veriť. Prvý kráča po správnej ceste a presne vie a vidí, kam ide, kým druhý len tápa bezcieľne a nevie kam ísť.</p></details><div class="break"></div><h2 id="_23" tabindex="-1">23 <a class="header-anchor" href="#_23" aria-label="Permalink to &quot;23&quot;">​</a></h2>',4),N=i('<div><div class="main-verse"><h1 class="verse-arabic">قُلْ هُوَ ٱلَّذِىٓ أَنشَأَكُمْ وَجَعَلَ لَكُمُ ٱلسَّمْعَ وَٱلْأَبْصَـٰرَ وَٱلْأَفْـِٔدَةَ ۖ قَلِيلًا مَّا تَشْكُرُونَ ٢٣</h1></div><p>Povedz (im, Muhammad): „On (Boh je ten, kto) vám dal vzniknúť a (kto) učinil vám sluch a zrak a srdcia (aby ste nimi všetko vôkol vnímali). Málokedy ďakujete (za to).“</p></div><div class="break"></div><h2 id="_24" tabindex="-1">24 <a class="header-anchor" href="#_24" aria-label="Permalink to &quot;24&quot;">​</a></h2>',3),B=i('<div><div class="main-verse"><h1 class="verse-arabic">قُلْ هُوَ ٱلَّذِى ذَرَأَكُمْ فِى ٱلْأَرْضِ وَإِلَيْهِ تُحْشَرُونَ ٢٤</h1></div><p>Povedz: „On (Boh) je ten, kto vás stvoril na zemi a k Nemu budete zhromaždení.“</p></div><div class="break"></div><h2 id="_25" tabindex="-1">25 <a class="header-anchor" href="#_25" aria-label="Permalink to &quot;25&quot;">​</a></h2>',3),g=i('<div><div class="main-verse"><h1 class="verse-arabic">وَيَقُولُونَ مَتَىٰ هَـٰذَا ٱلْوَعْدُ إِن كُنتُمْ صَـٰدِقِينَ ٢٥</h1></div><p>Hovoria (tí, ktorí k Bohu pridružujú a odmietajú veriť): „Kedy sa naplní tento sľub (nastane súdny deň), ak ste pravdovravní?“ (Je to adresované poslovi Muhammadovi a veriacim.)</p></div><div class="break"></div><h2 id="_26" tabindex="-1">26 <a class="header-anchor" href="#_26" aria-label="Permalink to &quot;26&quot;">​</a></h2>',3),D=i('<div><div class="main-verse"><h1 class="verse-arabic">قُلْ إِنَّمَا ٱلْعِلْمُ عِندَ ٱللَّهِ وَإِنَّمَآ أَنَا۠ نَذِيرٌ مُّبِينٌ ٢٦</h1></div><p>Povedz (im, Muhammad): „Poznanie (času príchodu trápenia, dňa zmŕtvychvstania a súdneho dňa) je len u Boha. Ja som len varovateľ zjavný (pravdivý)“.</p></div><div class="break"></div><h2 id="_27" tabindex="-1">27 <a class="header-anchor" href="#_27" aria-label="Permalink to &quot;27&quot;">​</a></h2>',3),R=i('<div><div class="main-verse"><h1 class="verse-arabic">فَلَمَّا رَأَوْهُ زُلْفَةً سِيٓـَٔتْ وُجُوهُ ٱلَّذِينَ كَفَرُوا وَقِيلَ هَـٰذَا ٱلَّذِى كُنتُم بِهِۦ تَدَّعُونَ ٢٧</h1></div><p>Keď ho (trápenie a deň zmŕtvychvstania) uvidia, ako sa priblížil, ustarostené ostanú tváre tých, ktorí odmietli veriť a bude (im) povedané: „Toto je to, o čo ste žiadali (z čoho ste si posmech robili a čo ste žiadali, keď ste boli predtým varovaní)“.</p></div><div class="break"></div><h2 id="_28" tabindex="-1">28 <a class="header-anchor" href="#_28" aria-label="Permalink to &quot;28&quot;">​</a></h2>',3),E=i('<div><div class="main-verse"><h1 class="verse-arabic">قُلْ أَرَءَيْتُمْ إِنْ أَهْلَكَنِىَ ٱللَّهُ وَمَن مَّعِىَ أَوْ رَحِمَنَا فَمَن يُجِيرُ ٱلْكَـٰفِرِينَ مِنْ عَذَابٍ أَلِيمٍ ٢٨</h1></div><p>Povedz (im, Muhammad): „Vidíte, ak by ma Boh zahubil i tých (veriacich), ktorí sú so mnou, alebo by nás milosťou zahrnul, kto (potom) ochranu poskytne tým, ktorí veriť odmietli, pred trápením bolestivým? (Bez ohľadu na to, čo sa s nami stane, ak neuveríte a nebudete nasledovať to, čo Boh uložil, nik vás pred trápením nezachráni. Zanechajte zášť, ktorú voči nám máte a uvedomte si konečne, kto je váš skutočný Boh a k Nemu sa obráťte)“.</p></div><div class="break"></div><h2 id="_29" tabindex="-1">29 <a class="header-anchor" href="#_29" aria-label="Permalink to &quot;29&quot;">​</a></h2>',3),O=i('<div><div class="main-verse"><h1 class="verse-arabic">قُلْ هُوَ ٱلرَّحْمَـٰنُ ءَامَنَّا بِهِۦ وَعَلَيْهِ تَوَكَّلْنَا ۖ فَسَتَعْلَمُونَ مَنْ هُوَ فِى ضَلَـٰلٍ مُّبِينٍ ٢٩</h1></div><p>Povedz (im, Muhammad): „Je to (Boh) Ten, v moci ktorého je milosť (jediný, kto by vás mohol zachrániť). Uverili sme v Neho a na Neho sme sa spoľahli. Budete vedieť (až čas nastane), kto je v blude zjavnom (my, alebo vy)“.</p></div><div class="break"></div><h2 id="_30" tabindex="-1">30 <a class="header-anchor" href="#_30" aria-label="Permalink to &quot;30&quot;">​</a></h2>',3),M=o("div",null,[o("div",{class:"main-verse"},[o("h1",{class:"verse-arabic"},"قُلْ أَرَءَيْتُمْ إِنْ أَصْبَحَ مَآؤُكُمْ غَوْرًا فَمَن يَأْتِيكُم بِمَآءٍ مَّعِينٍ ٣٠")]),o("p",null,"Povedz (im a spýtaj sa ich, Muhammad): „Vidíte, ak by vaša voda (ktorú zo studní čerpáte, pijete z nej a polievate) ostala hlboko (v zemi) skrytá (tak, že by ste sa k nej nedostali), kto vám (okrem Boha) privedie vodu tečúcu?“")],-1);function K(J,$,w,H,Q,Z){const a=t("Badge");return r(),d("div",null,[_,e(a,{type:"info",text:"67:1",class:"badge"}),l,e(a,{type:"info",text:"67:2",class:"badge"}),n,e(a,{type:"info",text:"67:3",class:"badge"}),h,e(a,{type:"info",text:"67:4",class:"badge"}),c,e(a,{type:"info",text:"67:5",class:"badge"}),m,e(a,{type:"info",text:"67:6",class:"badge"}),b,e(a,{type:"info",text:"67:7",class:"badge"}),p,e(a,{type:"info",text:"67:8",class:"badge"}),k,e(a,{type:"info",text:"67:9",class:"badge"}),T,e(a,{type:"info",text:"67:10",class:"badge"}),u,e(a,{type:"info",text:"67:11",class:"badge"}),P,e(a,{type:"info",text:"67:12",class:"badge"}),A,e(a,{type:"info",text:"67:13",class:"badge"}),S,e(a,{type:"info",text:"67:14",class:"badge"}),y,e(a,{type:"info",text:"67:15",class:"badge"}),z,e(a,{type:"info",text:"67:16",class:"badge"}),j,e(a,{type:"info",text:"67:17",class:"badge"}),f,e(a,{type:"info",text:"67:18",class:"badge"}),V,e(a,{type:"info",text:"67:19",class:"badge"}),q,e(a,{type:"info",text:"67:20",class:"badge"}),x,e(a,{type:"info",text:"67:21",class:"badge"}),I,e(a,{type:"info",text:"67:22",class:"badge"}),C,e(a,{type:"info",text:"67:23",class:"badge"}),N,e(a,{type:"info",text:"67:24",class:"badge"}),B,e(a,{type:"info",text:"67:25",class:"badge"}),g,e(a,{type:"info",text:"67:26",class:"badge"}),D,e(a,{type:"info",text:"67:27",class:"badge"}),R,e(a,{type:"info",text:"67:28",class:"badge"}),E,e(a,{type:"info",text:"67:29",class:"badge"}),O,e(a,{type:"info",text:"67:30",class:"badge"}),M])}const G=s(v,[["render",K]]);export{F as __pageData,G as default};
